Insert into SYS.SCHEDULER$_PROGRAM (OBJ#,ACTION,NUMBER_OF_ARGS,COMMENTS,FLAGS,SCHEDULE_LIMIT,PRIORITY,JOB_WEIGHT,MAX_RUNS,MAX_FAILURES,MAX_RUN_DURATION,NLS_ENV,ENV,RUN_COUNT) values (20363,'DECLARE
         ename             VARCHAR2(30);
         exec_task         BOOLEAN;
       BEGIN
         -- check if tuning pack is enabled
         exec_task := prvt_advisor.is_pack_enabled(
                        dbms_management_packs.TUNING_PACK);

         -- check if we are in a pdb,
         -- since auto sqltune is not run in a pdb
         IF (exec_task AND -- tuning pack enabled
         sys_context(''userenv'', ''con_id'') <> 0 AND -- not in non-cdb
         sys_context(''userenv'', ''con_id'') <> 1  ) THEN -- not in root
           exec_task := FALSE;
         END IF;

         -- execute auto sql tuning task
         IF (exec_task) THEN
           ename := dbms_sqltune.execute_tuning_task(
                      ''SYS_AUTO_SQL_TUNING_TASK'');
         END IF;

         -- check whether we are in non-CDB or a PDB
         -- auto SPM evolve only runs in a non-CDB or a PDB, not the root.
         IF (sys_context(''userenv'', ''con_id'') = 0 OR
             sys_context(''userenv'', ''con_id'') > 2) THEN
           exec_task := TRUE;
         ELSE
           exec_task := FALSE;
         END IF;

         -- execute auto SPM evolve task
         IF (exec_task) THEN
           ename := dbms_spm.execute_evolve_task(''SYS_AUTO_SPM_EVOLVE_TASK'');
         END IF;
       END;',0,'Program to run automatic sql tuning and SPM evolve tasks, see dbmssqlt.sql and dbmsspm.sql',3,null,3,1,null,null,null,'NLS_LANGUAGE=''AMERICAN'' NLS_TERRITORY=''AMERICA'' NLS_CURRENCY=''$'' NLS_ISO_CURRENCY=''AMERICA'' NLS_NUMERIC_CHARACTERS=''.,'' NLS_CALENDAR=''GREGORIAN'' NLS_DATE_FORMAT=''DD-MON-RR'' NLS_DATE_LANGUAGE=''AMERICAN'' NLS_SORT=''BINARY_CI'' NLS_TIME_FORMAT=''HH.MI.SSXFF AM'' NLS_TIMESTAMP_FORMAT=''DD-MON-RR HH.MI.SSXFF AM'' NLS_TIME_TZ_FORMAT=''HH.MI.SSXFF AM TZR'' NLS_TIMESTAMP_TZ_FORMAT=''DD-MON-RR HH.MI.SSXFF AM TZR'' NLS_DUAL_CURRENCY=''$'' NLS_COMP=''BINARY'' NLS_LENGTH_SEMANTICS=''BYTE'' NLS_NCHAR_CONV_EXCP=''FALSE''','0102000002100000',null);
